import React, {useState, useEffect} from 'react'

const name= "Kalpana"

function Welcome_f() {

  const [date,setDate]=useState(0)

  useEffect(() => {
    let timerId = null
    timerId = setInterval(() =>{
      setDate({date: new Date()});

    },1000)

    return () => clearInterval(timerId)
  })
    return (
        <div>

          Hello  {name} your local time is {date.toLocaleTimeString()}

        </div>
    )
}

export default Welcome_f
